import Navbar from "../components/Navbar";
import Link from 'next/link'
import "../scss/index.scss";

const Index = () => {
    return (
        <Fragment>
            <Navbar />
            <Link href={`/item/${props.itemId}`}>
                <a>link to Item page</a>
            </Link>
            <p>index</p>
        </Fragment>
    );
};

Index.getInitialProps = async function({props}){
    return {
        itemId:1
    }
}

export default Index;
